Se bem que a igreja matou um monte na aquisição então assediar pode né? 
Abre uma empresa de limpeza linda, porque tá passando pano de mais da conta já

@wmnnotfound @marc_gomes A única crise grave que experienciei foi a de 2009. Nessa altura aprendi que Portugal é imortal.

Mesmo com governo suicida (Sócrates, socialismo) e crise mundial, vi que Portugal nunca irá abaixo.

Nessa altura, Angola e Brasil resgataram esta terra de um destino bem pior.
